// Handle special kebab case for C++ and C#
export function techLabelToKebabCase(label) {
  if (label == "C++") {
    return "c-plus-plus";
  } else if (label == "C#") {
    return "c-sharp";
  } else {
    return kebabCase(label);
  }
}
